import React, { useState, useEffect } from 'react';
import { Box, Card, CardContent, Typography, Chip, Button, Grid, Tab, Tabs, Collapse } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

import { word_progress, word } from '../../Types';  // Ensure your School type has a non-optional SchoolId of type number

axios.defaults.baseURL = 'http://35.208.70.236/';


function Study() {
  const [words, setWords] = useState<word_progress[]>([]);
  const [wordDetails, setWordDetails] = useState<word | undefined>(undefined);
  const [user, setUser] = useState<any>(null);
  const [activeTab, setActiveTab] = useState(0);  // 0 for GRE, 1 for TOEFL

  const navigate = useNavigate();

  const handleTabChange = (event: React.SyntheticEvent, newValue: number) => {
    setActiveTab(newValue);
  };

  useEffect(() => {
    const rawData = sessionStorage.getItem('user');
    if (rawData) {
        const savedData = JSON.parse(rawData);
        if (savedData && savedData[0]) {
            setUser(savedData[0]);
        }
    }
  }, []);

  useEffect(() => {
    fetchWords();
  }, [activeTab]);

  const fetchWords = async () => {
    const TestId = activeTab === 0 ? 0 : 3;
    try {
      const response = await axios.get('/api/Study', { 
        params: {
          Email: user.Email, TestId:TestId
        }
      });
      const processedWords = response.data.map((word: any) => ({
        ...word,
        PercentLearned: word.PercentLearned !== undefined ? word.PercentLearned : 0, // Default to 0 if not provided
      }));
      setWords(processedWords);

    } catch (error) {
      console.error('Failed to fetch words:', error);
      setWords([]);
    }
  };

  const handleLearnClick = (word_progress: word_progress) => {

    axios.post('/api/Learns/modify', {
      Email: user.Email,
      TestId: activeTab === 0 ? 0 : 3,
      WordId: word_progress.WordId,
      PercentLearned: Math.min(word_progress.PercentLearned + 10, 100)
    })
      .then(() => {
        console.log('Learning progress updated');
        word_progress.Learned = true;
      })
      .catch((error) => console.error('Failed to update learning progress:', error));
  };

  const handleDetailsClick = async (word_progress: word_progress) => {
    const TestId = activeTab === 0 ? 0 : 3;
    try {
      const response = await axios.get('/api/Word', { 
        params: {
          WordId: word_progress.WordId, TestId: TestId
        }
      });
      setWordDetails(response.data);
    } catch (error) {
      console.error('Failed to fetch word details:', error);
      setWordDetails(undefined);
    }
  };

  return (
    <Box sx={{ width: '100%' }}>
      <Tabs value={activeTab} onChange={handleTabChange} centered>
        <Tab label="GRE" />
        <Tab label="TOEFL" />
      </Tabs>

      <Grid container spacing={2}>
        {words.map((word) => (
          <Grid item key={word.Word} xs={12} md={6} lg={4}>
            <Box display="flex" flexDirection="column" alignItems="center" justifyContent="center" height="100vh">
              <Card sx={{ minWidth: 275, maxWidth: 600, mt: 5 }}>
                <CardContent>
                  <Typography variant="h4" gutterBottom component="div" color="primary">
                    {word.Word}
                  </Typography>
                  <Chip label={word.PercentLearned} color="secondary" sx={{ mb: 2 }} />
                  <Typography variant="body1" gutterBottom>
                    <strong>Description:</strong> {word.LastLearnedTime}
                  </Typography>
                  <Button variant="contained" color="primary" disabled={!word.PercentLearned} onClick={() => handleLearnClick(word)}>
                    Learn
                  </Button>
                  <Button variant="contained" color="primary" onClick={() => handleDetailsClick(word)}>
                    Details
                  </Button>
                  <Collapse in={wordDetails && wordDetails.Word === word.Word}>
                    <Box display="flex" flexDirection="column" alignItems="center" justifyContent="center" height="100vh">
                      {wordDetails && (
                        <Card sx={{ minWidth: 275, maxWidth: 600, mt: 5 }}>
                          <CardContent>
                            <Typography variant="h4" gutterBottom component="div" color="primary">
                              {wordDetails.Word}
                            </Typography>
                            <Chip label={wordDetails.PartOfSpeech} color="secondary" sx={{ mb: 2 }} />
                            <Typography variant="body1" gutterBottom>
                              <strong>Description:</strong> {wordDetails.Description}
                            </Typography>
                            <Typography variant="body1" gutterBottom>
                              <strong>Stem:</strong> {wordDetails.Stem}
                            </Typography>
                            <Typography variant="body1">
                              <strong>Example:</strong> {wordDetails.Example}
                            </Typography>
                          </CardContent>
                        </Card>
                      )}
                    </Box>
                  </Collapse>
                </CardContent>
              </Card>
            </Box>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}

export default Study;
